Calibri;mso-bidi-font-family:Calibri;color:#393939;mso-ansi-language:EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:26.0pt;mso-pagination:none;mso-layout-grid-align:
none;text-autospace:none&quot;&gt;&lt;span style=&quot;font-size: medium; &quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri; color: rgb(57, 57, 57); &quot;&gt;I can see this broccoli market splitting into two. A market for first class quality broccoli that will be at a definite premium price. Then there will be another market for inferior quality broccoli at a reduced price. Quality is the key and good quality broccoli is what I would be looking for, giving you greater shelf life and taste!&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family:Arial;
color:#393939;mso-ansi-language:EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;
&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-bottom:20.0pt;mso-pagination:none;mso-layout-grid-align:
none;text-autospace:none&quot;&gt;&lt;span style=&quot;font-size: medium; &quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: Calibri; color: rgb(57, 57, 57); &quot;&gt;Steamed, used in a stir fry, with a dip or raw, broccoli is versatile, easy and nutritious. To ensure peak flavour and nutrition, simply cook broccoli lightly. Dip broccoli sprigs into boiling water for approximately thirty seconds to enhance their rich green colour and then cool before serving.&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;
