&lt;h2&gt;About the author of this article...&lt;/h2&gt;
&lt;span style=&quot;margin-top: 4px; width: 80px; float: left&quot;&gt;&lt;fb:like data-layout=&quot;button_count&quot; font=&quot;arial&quot; show_faces=&quot;false&quot; width=&quot;140&quot; send=&quot;false&quot; href=&quot;http://socexchange.com.au/soc.php?cp=report&quot;&gt;&lt;/fb:like&gt;&lt;/span&gt;&lt;span style=&quot;margin-top: 4px; width: 80px; float: left; margin-left: 15px&quot;&gt;&lt;a data-url=&quot;http://socexchange.com.au/soc.php?cp=report&quot; data-via=&quot;SOC exchange&quot; data-lang=&quot;en&quot; class=&quot;twitter-share-button&quot; href=&quot;https://twitter.com/share&quot;&gt;Tweet&lt;/a&gt;&lt;/span&gt;
&lt;p&gt;&lt;span class=&quot;title&quot;&gt;Name&lt;/span&gt;&lt;span&gt;Franco Lagudi&lt;br /&gt;
&lt;/span&gt;&lt;/p&gt;
&lt;b&gt;&lt;br /&gt;
&lt;/b&gt;
&lt;p&gt;&lt;span class=&quot;title&quot;&gt;About&lt;/span&gt;&lt;span&gt;Franco is CEO of SOC exchange Food &amp;amp; Wine, the online marketplace for food retailers Australia wide. Franco is a 3rd generation fruit &amp;amp; vegetable wholesaler and retailer - supplying hundreds of fresh food &amp;amp; grocery retailers, including the major national and state chains. He is in the business of supplying and advising retailers on fruit and vegetable price movements, quality and quantity throughout Australia. With his family, he owns and operates two fresh food retail stores: Harris Farm Markets in Sydney's Edgecliff and Mother Nature's Top Fruit Market in Coffs Harbour.&amp;nbsp;His long days usually start at 1:30am and, yes, he wishes he studied harder at school.&lt;br /&gt;
&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;&amp;nbsp;&lt;/p&gt;
&lt;p&gt;&lt;span&gt;Left - Francesco Lagudi at the family fruit shop in&amp;nbsp;Bondi Junction, Circa 1945.&lt;/span&gt;&lt;span&gt;Right - Grandson Franco Lagudi, 2012&lt;/span&gt;&lt;/p&gt;
&lt;/div&gt;
